class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """

        # 字符串可以看成是一个list
        i = 0
        total_length = len(s)
        # 这样就可以不引入math模块了
        final_length = 0
        if total_length < 2:
            return total_length

        while i < (total_length - 1):
            temp_list = []
            for c in s[i:]:
                if c in temp_list:
                    break
                else:
                    temp_list.append(c)
            # 这里会出现,abcde,执行完了,没有相同的.或者 abcda,有相同的跳出
            temp_list_length = len(temp_list)
            final_length = temp_list_length if temp_list_length >= final_length else final_length
            if final_length >= (total_length - 1 - i):
                return final_length
            i = i + 1


